{
	ssize_t cnt=0; 
	uint64_t reg_val; 

	int inst = 0; 
	for (inst=0; inst<1; inst++) 
	{
		reg_val = *((uint64_t*)(((void*)(interfaces[0].rf_base_addresses[0]))+13312+inst*8));

		cnt+=sprintf(buf, "srctag_mask [59:52] : %llx;\n ", (long long unsigned int)bit_get(52, 8, reg_val));
		buf+=strlen(buf);
		cnt+=sprintf(buf, "address_mask [51:0] : %llx;\n ", (long long unsigned int)bit_get(0, 52, reg_val));
		buf+=strlen(buf);
		cnt+=sprintf(buf, "\n");
		buf+=strlen(buf);
	} // EOF For instances 
	return cnt; 
}

