//==========================================================
// Helper function for bit filtering
//==========================================================
long unsigned int
bit_get(unsigned int bit_offset, unsigned int bit_length, long unsigned int value)
{
	uint64_t mask = 0;

	if (bit_length >= 64)
		mask = 0xffffffffffffffffull;
	else
		mask = (1ull << bit_length)-1;

	return (value >> bit_offset) & mask;
}


