static struct attribute_group extoll_rf_attr_grp = { .name = "extoll_rf", .attrs = extoll_rf_attrs };

int extoll_rf_create_sysfs_extoll_rf_files(extoll_device_t **devices,unsigned int devices_count)
{
    int retval;
    int di = 0;
    if (devices==0)
        return -EFAULT;

    //-- Create RFS interface array
    //--------------------
    interfaces_count = devices_count;
    interfaces = (extoll_rfs_interface_t *) kmalloc(sizeof(extoll_rfs_interface_t)*interfaces_count,GFP_KERNEL);


    //-- Create RF for each device
    //-- One folder per device, files support the multiple units
    for (di=0;di < devices_count;di++) {

        //-- Variables
        int ui = 0;
        char device_name[20];
        char device_index[5];

        //-- Save device
        interfaces[di].device = devices[di];

        //-- Create an attribute group
        sprintf(device_index,"_d%d",di);
        sprintf(device_name,"extoll_rf%s",(devices_count==1 ? "" : device_index));
        interfaces[di].attribute_group.name  = device_name;
        interfaces[di].attribute_group.attrs = extoll_rf_attrs;
        retval = sysfs_create_group(&(devices[di]->devp->dev.kobj),&(interfaces[di].attribute_group));
        if (retval) {
            //-- If fail, return error
            return retval;
        }

        //-- Set the interface
        interfaces[di].rf_base_addresses = kmalloc(sizeof(long unsigned int*)*devices[di]->units_count,GFP_KERNEL);

        //-- For each unit: Gather the RF base address and set on interface
        for (ui = 0 ; ui < devices[di]->units_count ; ui++) {
            interfaces[di].rf_base_addresses[0] = devices[di]->units[ui].fu_regions[devices[di]->units[ui].rf_region_index]->vaddress;
        }



    }

    return 0;
}
EXPORT_SYMBOL(extoll_rf_create_sysfs_extoll_rf_files);

void extoll_rf_remove_sysfs_extoll_rf_files(void)
{
    //-- Variables
    int di = 0;

    //-- For all devices, remove attributes group
    for (di=0;di < interfaces_count;di++) {
        sysfs_remove_group(&(interfaces[di].device->devp->dev.kobj), &(interfaces[di].attribute_group));
    }

    //-- Clear registered interfaces
    interfaces_count = 0;
    kfree(interfaces);

}

EXPORT_SYMBOL(extoll_rf_remove_sysfs_extoll_rf_files);

